{
  "private": true,
  "name": "primitives",
  "version": "0.0.0",
  "license": "MIT",
  "workspaces": [
    "ssr-testing",
    "packages/*/*"
  ],
  "scripts": {
    "lint": "eslint packages --ext .js,.ts,.tsx",
    "types:check": "tsc --skipLibCheck --noEmit",
    "test": "jest",
    "test:ci": "yarn types:check && jest --ci && yarn cypress:ci",
    "storybook": "BROWSER=none storybook dev -p 9009",
    "cypress:ci": "start-server-and-test storybook http://localhost:9009 cypress:run",
    "cypress:run": "cypress run",
    "cypress:dev": "cypress open",
    "dev": "yarn storybook",
    "build-storybook": "storybook build",
    "build": "node build.mjs",
    "publish:stable": "yarn bump:stable && yarn clean && yarn build && yarn workspaces foreach -pvW --exclude primitives --exclude ssr-testing npm publish --tolerate-republish --access public",
    "publish:next": "yarn bump:next && yarn clean && yarn build && yarn workspaces foreach -pvW --exclude primitives --exclude ssr-testing npm publish --tolerate-republish --access public --tag next",
    "clean": "yarn workspaces foreach -pvW --exclude primitives --exclude ssr-testing run clean",
    "reset": "yarn clean && rm -rf node_modules .yarn/cache",
    "bump:stable": "yarn version apply --all",
    "bump:next": "yarn version apply --all --prerelease",
    "bump:check": "yarn version check"
  },
  "dependencies": {
    "react": "^18.3.1",
    "react-dom": "^18.3.1"
  },
  "devDependencies": {
    "@stitches/core": "^1.2.8",
    "@storybook/addon-essentials": "^7.6.17",
    "@storybook/addon-storysource": "^7.6.17",
    "@storybook/react": "^7.6.17",
    "@storybook/react-webpack5": "^7.6.17",
    "@storybook/test": "^7.6.17",
    "@testing-library/cypress": "^7.0.6",
    "@testing-library/dom": "^10.1.0",
    "@testing-library/jest-dom": "^5.16.4",
    "@testing-library/react": "^16.0.0",
    "@testing-library/user-event": "^14.1.0",
    "@types/eslint": "^7.28.0",
    "@types/fs-extra": "^11",
    "@types/jest": "^27.4.1",
    "@types/jest-axe": "^3.5.3",
    "@types/react": "^18.0.5",
    "@types/react-dom": "^18.0.0",
    "@types/react-test-renderer": "^18.0.0",
    "@typescript-eslint/eslint-plugin": "^5.19.0",
    "@typescript-eslint/parser": "^5.19.0",
    "cypress": "^8.0.0",
    "cypress-real-events": "^1.5.0",
    "esbuild": "0.21.4",
    "eslint": "^7.32.0",
    "eslint-config-react-app": "^6.0.0",
    "eslint-plugin-cypress": "^2.11.3",
    "eslint-plugin-flowtype": "4.x",
    "eslint-plugin-import": "^2.22.0",
    "eslint-plugin-jsx-a11y": "^6.3.1",
    "eslint-plugin-react": "^7.24.0",
    "eslint-plugin-react-hooks": "^4.2.0",
    "eslint-plugin-storybook": "^0.8.0",
    "fs-extra": "^11.1.1",
    "glob": "^10.2.2",
    "husky": "^4.3.6",
    "jest": "^27.5.1",
    "jest-axe": "^6.0.0",
    "jest-watch-typeahead": "^1.0.0",
    "lint-staged": "^10.5.3",
    "prettier": "^2.0.5",
    "pretty-quick": "^2.0.1",
    "react-test-renderer": "^18.0.0",
    "replace-in-files": "^3.0.0",
    "start-server-and-test": "2.0.3",
    "storybook": "^7.6.17",
    "ts-jest": "^27.1.4",
    "tsup": "8.0.2",
    "typescript": "^4.6.3"
  },
  "resolutions": {
    "chokidar": "3.4.3"
  },
  "engines": {
    "node": ">=12",
    "yarn": ">=2"
  },
  "jest": {
    "testEnvironment": "jsdom",
    "roots": [
      "<rootDir>/packages"
    ],
    "testMatch": [
      "**/?(*.)+(test).+(ts|tsx|js)"
    ],
    "transform": {
      "^.+\\.(ts|tsx)$": "ts-jest"
    },
    "moduleNameMapper": {
      "@radix-ui/react-(.+)$": "<rootDir>/packages/react/$1/src",
      "@radix-ui/(.+)$": "<rootDir>packages/core/$1/src"
    },
    "watchPlugins": [
      "jest-watch-typeahead/filename",
      "jest-watch-typeahead/testname"
    ],
    "setupFilesAfterEnv": [
      "<rootDir>/scripts/setup-tests.ts",
      "jest-axe/extend-expect"
    ]
  },
  "prettier": {
    "printWidth": 100,
    "singleQuote": true
  },
  "eslintConfig": {
    "extends": [
      "react-app",
      "plugin:jsx-a11y/recommended",
      "plugin:storybook/recommended"
    ],
    "plugins": [
      "jsx-a11y"
    ],
    "settings": {
      "react": {
        "version": "detect"
      }
    },
    "rules": {
      "import/no-anonymous-default-export": [
        1,
        {
          "allowObject": true
        }
      ],
      "react/jsx-pascal-case": [
        2,
        {
          "allowNamespace": true
        }
      ],
      "no-unused-vars": "off",
      "@typescript-eslint/no-unused-vars": "off",
      "prefer-const": [
        1,
        {
          "destructuring": "all"
        }
      ],
      "jsx-a11y/label-has-associated-control": [
        2,
        {
          "controlComponents": [
            "Checkbox"
          ],
          "depth": 3
        }
      ]
    }
  },
  "eslintIgnore": [
    "node_modules",
    "dist"
  ],
  "husky": {
    "hooks": {
      "pre-commit": "pretty-quick --staged && lint-staged",
      "pre-push": "yarn types:check && yarn bump:check"
    }
  },
  "lint-staged": {
    "*.{js,ts,tsx}": "eslint --quiet --fix --cache"
  },
  "packageManager": "yarn@4.1.0"
}

{
  "name": "lona",
  "private": true,
  "version": "0.0.0",
  "description": "A tool for defining design systems and using them to generate cross-platform UI code, Sketch files, and other artifacts.",
  "directories": {
    "doc": "docs",
    "example": "examples"
  },
  "scripts": {
    "test": "echo \"Error: no test specified\" && exit 1",
    "lint": "eslint --quiet . && (cd studio && ./Pods/SwiftLint/swiftlint)",
    "prettier:base": "prettier --write --ignore-path ./config/.prettierignore",
    "lint-staged": "lint-staged"
  },
  "repository": {
    "type": "git",
    "url": "git+https://github.com/airbnb/Lona.git"
  },
  "license": "MIT",
  "bugs": {
    "url": "https://github.com/airbnb/Lona/issues"
  },
  "homepage": "https://github.com/airbnb/Lona#readme",
  "devDependencies": {
    "eslint": "^5.16.0",
    "eslint-config-airbnb": "^17.1.0",
    "eslint-config-prettier": "^4.1.0",
    "eslint-plugin-import": "^2.16.0",
    "eslint-plugin-jsx-a11y": "^6.2.1",
    "eslint-plugin-prettier": "^3.0.1",
    "eslint-plugin-react": "^7.12.4",
    "lint-staged": "^8.1.5",
    "pre-commit": "^1.2.2",
    "prettier": "^1.16.4"
  },
  "pre-commit": [
    "lint-staged"
  ],
  "lint-staged": {
    "linters": {
      "*.swift": [
        "./config/pre-commit-swiftlint.sh"
      ],
      "*.{js,jsx}": [
        "npm run prettier:base",
        "eslint",
        "git add"
      ],
      "*.md": [
        "npm run prettier:base",
        "git add"
      ]
    },
    "ignore": [
      "/examples"
    ]
  },
  "prettier": {
    "proseWrap": "never",
    "singleQuote": true,
    "trailingComma": "es5",
    "semi": false
  },
  "eslintConfig": {
    "root": true,
    "extends": [
      "airbnb",
      "prettier"
    ],
    "plugins": [
      "prettier"
    ],
    "rules": {
      "import/no-dynamic-require": "off",
      "import/prefer-default-export": "off",
      "react/jsx-filename-extension": "off",
      "react/jsx-indent": "off",
      "react/destructuring-assignment": "off",
      "react/jsx-one-expression-per-line": "off",
      "no-param-reassign": "off",
      "no-underscore-dangle": "off",
      "global-require": "off",
      "prettier/prettier": [
        "error",
        {
          "singleQuote": true,
          "trailingComma": "es5",
          "semi": false
        }
      ]
    }
  },
  "eslintIgnore": [
    "/compiler/core",
    "/examples",
    "/**/node_modules",
    "/compiler/react-component-analyzer/examples",
    "/studio/Carthage",
    "/studio/LonaStudio",
    "/studio/Pods",
    "/studio/workspace",
    "/studio/embedded-sites/markdown-editor/build"
  ]
}

{
  "name": "radix-vue",
  "version": "1.9.8",
  "private": true,
  "packageManager": "pnpm@9.4.0",
  "license": "MIT",
  "repository": "unovue/radix-vue",
  "workspaces": [
    "packages/*"
  ],
  "scripts": {
    "story:dev": "pnpm --filter histoire story:dev --open",
    "build": "rimraf packages/radix-vue/dist  && pnpm run --filter radix-vue build && pnpm run --filter plugins build",
    "build-only": "rimraf packages/radix-vue/dist  && pnpm run -r build-only",
    "docs:install": "pnpm --filter docs install",
    "docs:dev": "pnpm --filter docs docs:dev",
    "docs:build": "pnpm --filter docs docs:build",
    "docs:gen": "pnpm --filter docs docs:gen",
    "docs:contributors": "pnpm --filter docs docs:contributors",
    "prepare": "pnpm simple-git-hooks",
    "test": "pnpm --filter radix-vue test",
    "lint": "eslint . --cache",
    "lint:fix": "eslint . --cache --fix",
    "bumpp": "bumpp package.json packages/*/package.json docs/package.json",
    "pub:release": "cd packages/radix-vue && pnpm pub:release"
  },
  "devDependencies": {
    "@antfu/eslint-config": "^2.27.3",
    "@commitlint/cli": "^19.3.0",
    "@commitlint/config-conventional": "^19.2.2",
    "bumpp": "^9.4.1",
    "eslint": "^9.10.0",
    "lint-staged": "^15.2.10",
    "pnpm": "^9.4.0",
    "rimraf": "^6.0.1",
    "simple-git-hooks": "^2.11.1",
    "typescript": "5.3.3"
  },
  "commitlint": {
    "extends": [
      "@commitlint/config-conventional"
    ]
  },
  "pnpm": {
    "patchedDependencies": {
      "vitepress@1.2.3": "patches/vitepress@1.2.3.patch"
    }
  },
  "simple-git-hooks": {
    "pre-commit": "pnpm lint-staged",
    "commit-msg": "pnpm commitlint --edit ${1}"
  },
  "lint-staged": {
    "*": "eslint --fix"
  }
}

